    a2 = (2*h2 + h1) / (h2 * (h1 + h2));
    a1 = -(h1 + h2) / (h1 * h2);
    a0 = h2 / (h1 * (h1 + h2));
    YN = (dYN - a1 * Y1 - a0 * Y0) / (a2 - 1/lambda);